import React from 'react';
import s from './Header.module.css';

const Header = () => {
    return <header className={s.header}>
        <a href="https://www.youtube.com/watch?v=GPabDsMyceU" target="_blank">
        <img src="https://content.foto.my.mail.ru/mail/deil118/_myphoto/h-3.jpg"  />
        </a>
    </header>
}


export default Header;
